from math import prod
from itertools import count, islice
from sympy import factorint, nextprime
def agen(): # generator of terms
    pk, pik = 2, 0
    for k in count(1):
        if k == pk:
            pk, pik = nextprime(pk), pik + 1
        f = factorint(k)
        phik = prod((p - 1)*p**(e-1) for p, e in f.items())
        tauk = prod(e+1 for e in f.values())
        if phik == pik + tauk:
            yield k
